import React, {useState} from 'react';
import styles from "./App.style";
import linkedinLogo from "./linkedin-logo.png";
import githubLogo from "./pngkey.com-github-icon-png-1787243.png";
import gitlabLogo from "./GitLab_Logo.svg.png";
import reactLogo from "./1200px-React-icon.svg.png";

function App() {
    let [logoAngle,setLogoAngle] = useState(0);

    setInterval(() => {
        setLogoAngle(logoAngle + 1)
        if(logoAngle===360) setLogoAngle(0);
        console.log()
    },100);

  return (
    <div style={styles.app}>
      <div style={styles.header}>

          <div style={styles.logoContainer}>
            <img alt={"reactLogo"} src={reactLogo} style={{...styles.logo, transform: 'rotate('+logoAngle+'deg)'}}/>
          </div>

          <div style={styles.infosContainer}>
              <div style={styles.photo}/>
              <div>
                  <p style={styles.name}>Alexandre BRAJEUX</p>
                  <p style={styles.job}>DÃ©veloppeur React</p>
              </div>
          </div>

          <div  style={styles.linkIconsContainer}>
              <a href={"https://www.linkedin.com/in/alexandre-brajeux/"}><img src={linkedinLogo} alt={"linkedingLogo"} style={styles.linkIcon}/></a>
              <a href={"https://github.com/abrajeux"}><img src={githubLogo} alt={"githubLogo"} style={styles.linkIcon}/></a>
              <a href={"https://gitlab.com/abrajeux"}><img src={gitlabLogo} alt={"gitlabLogo"} style={styles.linkIcon}/></a>
          </div>
      </div>
    </div>
  );
}

export default App;
